import React from "react";

const ReadRicki = ({ info }) => {
  console.log(info);
  return (
    <div>
      <ul>
        {info.map(item => (
          <>
            <li>{item.name}</li>
            <img src={item.url} alt="" />
          </>
        ))}
      </ul>
    </div>
  );
};

export default ReadRicki;
